able editable-click\">别墅</a> </td>   <td> <a href=\"#\" data-value=\"5\" class=\"actionType editable editable-click\">进件</a>&nbsp;  <a href=\"#\" class=\"actionVal editable editable-click\" data-value=\"是\" actionparamid=\"5\">是</a>  </td>  <td> <div class=\"layui-btn-group\"> <!--<button class=\"layui-btn layui-btn-primary layui-btn-sm saveRow\" onclick=\"hb();\"><i class=\"layui-icon\">&#xe618;</i></button>--> <button class=\"layui-btn layui-btn-primary layui-btn-sm addRow\" onclick=\"addRow(this)\"><i class=\"layui-icon\"></i></button> <button class=\"layui-btn layui-btn-primary layui-btn-sm deleteRow\" onclick=\"deleteRow(this)\"><i class=\"layui-icon\"></i></button> </div> </td> </tr>  </tbody> ', 'package com.drools.rules\r\nimport com.ht.risk.model.fact.RuleExecutionResult\r\nimport com.ht.risk.model.fact.RuleExecutionObject\r\nimport com.ht.risk.service.DroolsActionService\r\nglobal RuleExecutionResult _result\r\nimport java.lang.String\r\nimport java.util.Map\r\nimport java.util.List\r\n\r\nrule \"规则-1\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'集体用地\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"否\");\r\n_result.getMap().put(\"rule\",\"规则-1\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n\r\nrule \"规则-2\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'宅基地\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"否\");\r\n_result.getMap().put(\"rule\",\"规则-2\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n\r\nrule \"规则-3\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'性质为租赁\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"否\");\r\n_result.getMap().put(\"rule\",\"规则-3\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\