\n\r\n\r\nrule \"规则-4\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'工业用地\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"否\");\r\n_result.getMap().put(\"rule\",\"规则-4\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n\r\nrule \"规则-5\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'公共管理与公共服务设施用地\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"否\");\r\n_result.getMap().put(\"rule\",\"规则-5\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n\r\nrule \"规则-6\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'普通住宅\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"是\");\r\n_result.getMap().put(\"rule\",\"规则-6\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n\r\nrule \"规则-7\"\r\n\r\nwhen\r\n\r\n$fact:RuleExecutionObject()\r\n$action:DroolsActionService()\r\n$map:Map(this[\"type\"]==\'别墅\'  )\r\n\r\nthen\r\n_result.getMap().put(\"flag\",\"是\");\r\n_result.getMap().put(\"rule\",\"规则-7\");\r\n$action.execute($fact,_result,\"flag\");\r\n$action.saveLog($fact,_result);\r\nend\r\n\r\n\r\n', '1');
